INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 10118, 0, 91002, "ペコリーヌとの出会い", "フリーマーケット会場", 2, 40, 5118061, "青空の下で謁見", 7, 2834);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 10118, 0, 91002, "マホとの出会い", "フリーマーケット会場", 2, 40, 5118062, "未来の騎空団\nマスコット？", 7, 2835);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 10118, 0, 91002, "アキノとの出会い", "ランドソル市街地", 2, 40, 5118063, "お嬢さまからの\n緊急依頼", 7, 2837);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 10118, 0, 91002, "ジュンとの出会い", "フリーマーケット会場", 2, 40, 5118064, "黄金色の悩みごと", 18, 4108402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 10118, 0, 91002, "カオリとの出会い", "フリーマーケット会場", 2, 40, 5118065, "白熱！　格闘大会！", 18, 4107402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (1, 1, 8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 10118, 0, 91002, "ニノンとの出会い", "オーエド町", 2, 40, 5118066, "祭り太鼓はオーエドの華", 16, 9000227);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 10118, 0, 91002, "スズナとの出会い", "フリーマーケット会場", 3, 40, 5118067, "人気者は遅れて\nやってくる", 19, 2101181);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 10118, 0, 91002, "ナナカとの出会い", "ランドソル市街地", 3, 40, 5118068, "巫女・ミーツ・魔法少女", 18, 4109402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 10118, 0, 91002, "キャル＆コッコロとの出会い", "フリーマーケット会場", 3, 40, 5118069, "ネズ耳は二度なくなる", 18, 4305402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 10118, 0, 91002, "ユカリとの出会い", "ランドソル市街地", 3, 40, 5118070, "この出会いにカンパイ！", 18, 4101402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 1, 8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 10118, 0, 91002, "アオイとの出会い", "ランドソル市街地", 3, 40, 5118071, "陰陽アンサンブル", 18, 4106402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (1, 1, 8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 10118, 0, 91002, "シノブとの出会い", "フリーマーケット会場", 3, 40, 5118072, "運試し十番勝負！", 7, 2836);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 0, 0, 0, 10118, 10145115, 0, "オープニング", 0, 1, 0, 5118600, "彼女たちの新たな日常", 0, 0);
